INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (10, 8, "探検好きのイタズラっ子", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 0, "諸星すみれ", 27, "ミソギ", 9, "O", 128, "いたずら、探検", "ヒューマン", 100401, 5, "リトルリリカル");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (25, 11, "ヒーローに憧れる騎士見習いの少女", "？？？", 0, "下田麻美", 40, "マツリ", 12, "O", 146, "ヒーローごっこ", "獣人族", 100501, 8, "王宮騎士団（NIGHTMARE）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (22, 11, "甘え上手なみんなの人気者", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 0, "浅倉杏美", 42, "アカリ", 13, "O", 150, "サックス", "魔族", 100601, 7, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (23, 1, "プリン大好きゴースト娘", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 0, "雨宮天", 32, "ミヤコ", 14, "B", 130, "プリンを食べること", "魔族", 100701, 7, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (10, 10, "ボクは誰よりも美しい", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 0, "大空直美", 40, "ユキ", 14, "AB", 150, "鏡で自分を見ること", "エルフ", 100801, 15, "ヴァイスフリューゲル　ランドソル支部");
