INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (22, 9, "マホマホ王国のプリンセス", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 0, "内田真礼", 42, "マホ", 16, "O", 155, "空想、ぬいぐるみ集め", "獣人族", 101001, 10, "自警団（カォン）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (25, 8, "人懐っこくてマシンガントークな妹系少女", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 0, "阿澄佳奈", 44, "リノ", 15, "A", 156, "お裁縫", "ヒューマン", 101101, 3, "ラビリンス");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (24, 12, "みんなのために超能力を使う眠り姫", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 0, "大橋彩香", 46, "ハツネ", 17, "A", 156, "妹と遊ぶこと、二度寝、昼寝、早寝", "エルフ", 101201, 6, "フォレスティエ");
