INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, 11, "頭脳明晰な美少女名探偵", "test", 0, "水瀬いのり", 41, "カスミ", 15, "AB", 152, "読書、推理", "獣人族", 101401, 10, "自警団（カォン）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (5, 9, "母性溢れる優しいみんなの「ミサト先生」", "test", 0, "國府田マリ子", 54, "ミサト", 21, "O", 165, "絵本作り", "エルフ", 101501, 6, "フォレスティエ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (10, 4, "天真爛漫で人気者のカリスマモデル", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 0, "上坂すみれ", 48, "スズナ", 18, "O", 167, "ファッション", "魔族", 101601, 14, "ルーセント学院");
