INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, 4, "お歌もにんじんも、ウサギさんも大好き♪", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 0, "日高里菜", 21, "ミミ", 10, "O", 117, "かわいいもの集め", "獣人族", 102001, 5, "リトルリリカル");
