INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (22, 12, "占いが得意な霊能少女", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 0, "大坪由佳", 42, "シノブ", 18, "AB", 157, "占い", "魔族", 103101, 7, "悪魔偽王国軍（ディアボロス）");
