INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, 3, "みんなを笑顔にするお笑い牧場主", "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 0, "新田恵海", 35, "マヒル", 20, "B", 142, "漫才", "ヒューマン", 103301, 11, "牧場（エリザベスパーク）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (16, 3, "純情でほっとけない大人の女性", "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 0, "今井麻美", 55, "ユカリ", 22, "A", 164, "ウインドーショッピング", "エルフ", 103401, 12, "メルクリウス財団");
