INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (6, 6, "「友達」に憧れる、エルフの森の女の子", "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 0, "花澤香菜", 44, "アオイ", 13, "AB", 158, "友達作りのイメトレ", "エルフ", 104001, 6, "フォレスティエ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, 6, "人々を守るために歌う、唱喚士の少女", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 0, "福原綾香", 46, "チカ", 17, "O", 163, "各種楽器", "ヒューマン", 104201, 4, "カルミナ");
