INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (19, 11, "妄想大好き！　ほんとは照れ屋な女の子", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 0, "長妻樹里", 49, "クウカ", 18, "AB", 157, "小説を読むこと", "ヒューマン", 104501, 15, "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (1, 3, "弱きを助け強きをくじく猫娘", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 0, "沼倉愛美", 48, "タマキ", 18, "AB", 158, "猫とたわむれること", "獣人族", 104601, 12, "メルクリウス財団");
