INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (11, 11, "仕事も私事も効率優先な傭兵少女", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 0, "田所あずさ", 49, "ミフユ", 20, "O", 163, "傭兵などのアルバイト", "ヒューマン", 104801, 12, "メルクリウス財団");
